import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import CreatePost from './CreatePost';
import PostList from './PostList';
import Login from './Login';
import Register from './Register';
import UserProfile from './UserProfile';
import SearchBar from './SearchBar';
import PostDetail from './PostDetail';
import Header from './Header';
import Navbar from './Navbar';
import Hero from './Hero';
import './index.css';

function App() {
  const [posts, setPosts] = useState([]);
  const [filteredPosts, setFilteredPosts] = useState([]);
  const [user, setUser] = useState(null);
  const [darkMode, setDarkMode] = useState(false);

  useEffect(() => {
    // Fetch posts from API
    fetchPosts();
  }, []);

  const fetchPosts = async () => {
    // Implement API call to fetch posts
    // For now, we'll use dummy data
    const dummyPosts = [
      {
         id: 1, 
        title: 'The Impact of AI on Modern Journalism', 
        content: 'Artificial Intelligence is revolutionizing the way news is gathered, analyzed, and distributed. From automated fact-checking to personalized news feeds, AI is reshaping the landscape of modern journalism. This post explores the benefits and potential pitfalls of this technological shift in the media industry.', 
        author: 'John Doe',
        imageUrl: "data:image/jpeg;base64,"
      },
      {
         id: 2, 
         title: 'Mindfulness in the Digital Age', 
         content: 'In an era of constant connectivity, finding moments of peace can be challenging. This article discusses practical mindfulness techniques tailored for the digital age, helping readers maintain mental well-being while navigating the demands of our tech-driven world.', 
         author: 'Jane Smith',
         imageUrl: "data:image/jpeg;base64,"
        },
      {
        id: 3,
        title: "The Rise of Sustainable Tech",
        content: "As environmental concerns take center stage, the tech industry is responding with innovative sustainable solutions. From eco-friendly smartphones to energy-efficient data centers, this post examines the growing trend of sustainability in technology and its impact on consumers and the planet.",
        author: "Ethan Rop",
        imageUrl: "data:image/jpeg;base64,"
      },
      {
        id: 4,
        title: "Cybersecurity: Protecting Your Digital Life",
        content: "With cyber threats becoming increasingly sophisticated, protecting our digital lives has never been more crucial. This article provides practical tips and strategies for everyday internet users to enhance their cybersecurity, from creating strong passwords to recognizing phishing attempts.",
        author: "Olivia Lai",
        imageUrl: "data:image/jpeg;base64,"
      },
      {
        id: 5,
        title: "The Ethics of Data Privacy",
        content: "As tech companies collect vast amounts of personal data, questions about privacy and ethical use of information are more pertinent than ever. This post delves into the complex issues surrounding data privacy, discussing current regulations, potential future legislation, and what it means for individual users.",
        author: "Marcus Kamau",
        imageUrl: "data:image/jpeg;base64,"
      }
    ];
    setPosts(dummyPosts);
    setFilteredPosts(dummyPosts);
  };

  const handleSearch = (query) => {
    console.log("Searching for:", query);
    const filtered = posts.filter(post => 
      post.title.toLowerCase().includes(query.toLowerCase()) ||
      post.content.toLowerCase().includes(query.toLowerCase())
    );
    console.log("Filtered posts:", filtered);
    setFilteredPosts(filtered);
    <SearchBar onSearch={handleSearch} />
  };

  const addPost = (post) => {
    // Add post to API and update state
    const newPost = { ...post, id: Date.now() };
    setPosts([...posts, newPost]);
    setFilteredPosts([...filteredPosts, newPost]);
  };

  const deletePost = (id) => {
    // Delete post from API and update state
    const updatedPosts = posts.filter(post => post.id !== id);
    setPosts(updatedPosts);
    setFilteredPosts(updatedPosts);
  };

  const toggleDarkMode = () => {
    setDarkMode(!darkMode);
    document.body.classList.toggle('dark-mode');
  };

  return (
    <Router>
      <div className={`app ${darkMode ? 'dark-mode' : ''}`}>
      <Header />
      <Navbar user={user} setUser={setUser} toggleDarkMode={toggleDarkMode} darkMode={darkMode} />
        <div className="content-wrapper">
        <div className="container">
        <SearchBar onSearch={handleSearch} />
        <Routes>
          <Route path="/" element={<PostList posts={filteredPosts} />} />
          <Route path="/create" element={<CreatePost addPost={addPost} />} />
          <Route path="/post/:id" element={<PostDetail posts={posts} deletePost={deletePost} />} />
          <Route path="/login" element={<Login setUser={setUser} />} />
          <Route path="/register" element={<Register setUser={setUser} />} />
          <Route path="/profile" element={<UserProfile user={user} />} />
          <Route path="/" element={
            <>
              <Hero />
              <PostList posts={filteredPosts} />
            </>
          } />
        </Routes>
      </div>
      </div>
    </div>
    </Router>
  );
}

export default App;
